import React, { Component } from 'react';
import "./LeftPanel.css";
import ImageLayout from '../ImageLayout';


import profile from '../../../img/profile.png';
import mailbox from '../../../img/mailbox.png';
import groups from '../../../img/groups.png';


class LeftPanel extends Component {
    constructor(props) {
        super(props);
        this.state = { 
            data:[]
         }
    }

    getData=() => {
        let jsondata = [
            {
                "image": profile,
                "text": "Profile"
        },
            {
            "image": mailbox,
            "text":"Mailbox"
        },
    ];
        this.setState({data : jsondata});
    }

    componentDidMount(){
        this.getData();
    }

    render() { 
        return ( 
            <div>
                this.state.data.map( (item) => (
                    <ImageLayout image={profile} text="Profile"/>
                ))

                <ImageLayout image={mailbox} text="MailBox"/>
                <hr className="border"></hr>

                <ImageLayout image={mailbox} text="Message"/>
                <ImageLayout image={groups} text="Groups" background_color="gray"/>

                <ImageLayout image="https://qph.fs.quoracdn.net/main-qimg-965b11ec95106e64d37f5c380802c305-lq" text="Ohayo sekai"/>
                <ImageLayout image="https://qph.fs.quoracdn.net/main-qimg-965b11ec95106e64d37f5c380802c305-lq" text="Good morning world!"/>
            </div>
         );
    }
}

export default LeftPanel;
